import React from 'react'

import starGold from '../img/star-gold.png';
import avatar from '../img/avatar.png';
import win from '../img/vitoria.png';

import './styles.scss';

// const RankingMatch = (props) => {
//     return (
//         <div className="contentRanking">
//             <span className="position">{props.position}</span>
//             <img src={avatar}alt="Avatar"/>
//             <div className="contentRankingInfo">
//                 <span className="nameUser">{props.nameUser}</span>
//                 <span className="numberStars">{props.totalStars}</span>
//             </div>
//         </div>
//     )
// }

const InfoMatch = (props) => {
    return(
         <div className="contentOponente">
            <img src={avatar}alt="Avatar"/>
            <div className="contentTypeName">
                <span className="typeOponente">{props.opponentType}</span>
                <span className="nameOponente">{props.opponentName}</span>
            </div>
        </div>
    )
}

const renderTitle = props => {
    console.log("PROPS ::  ", props)
    let text = ` ${props.platform} · ${props.matchType}`
    if(props.members && props.members > 0)
        text += ` · ${props.members} Membros`

    return text
}

const Card = (props) => {
        console.log("ESSAS SAO AS PROPS: ", props)
        return (
            <div className="containerCard">
                {/* Primeira coluna */}
                <div className="containerImage">
                    <img className="imageGame" src={props.imageGame} alt="Game"></img>
                </div>
                {/* Final da primeira coluna */}

                {/* Segunda coluna */}
                <div className="containerInfo">
                    <div className="headerInfo">
                        <h3 className="nameGame">{props.nomeGame}</h3>
                        <span className="typeMatch">{renderTitle(props)}</span>
                    </div>
                    <div className="contentInfo">
                        <div className="containerDataDuration">
                            <div className="contentData">
                                <span className="subTextInfo">Data</span>
                                <span className="contentTextInfo">{props.date}</span>
                           </div>
                            <div className="contentDuration">
                                <span className="subTextInfo">Duração</span>
                                <span className="contentTextInfo">{props.duration} minutos</span>
                            </div>
                        </div>
                        <div className="containerBetPremium">
                            <div className="containerBet">
                                <img src={starGold} alt="Star Gold"></img>
                                <div className="contentBet">
                                    <span className="subTextInfo">Aposta</span>
                                    <span className="contentTextInfo">{props.bet} Star {props.starType}</span>
                                </div>
                            </div>
                            <div className="containerPremium">
                                <img src={starGold} alt="Star Gold"></img>
                                <div className="contentPremium">
                                    <span className="subTextInfo">Prêmio</span>
                                    <span className="contentTextInfo">{props.premium} Star {props.starType}</span>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
                {/* Final da segunda coluna */}

                {/* Terceira coluna */}
                <div className="containerTreeColumn">
                    {props.ranking && props.ranking.lenght > 0 ? 
                        props.ranking.map((item, index) => 
                            <RankingMatch  
                            key={index}
                            position={item.position}  
                            nameUser={item.nameUser}
                            totalStars={item.totalStars}
                            />
                        ) 
                        : <InfoMatch 
                            opponentName={props.opponentName}
                            opponentType={props.opponentType}
                        />
                    }
                </div>
                {/* Final terceira coluna */}

                {/* Quarta coluna  */}
                {props.winner && 
                    <div className="containerWin">
                    <img src={win} alt="Vitória"/>
                </div> 
                }
                {/* Final quarta coluna */}
            </div>

        ) 
}


export default Card;
